script: |
  super -f text -I q4586.spq | sort > q4586.out

inputs:
  - name: q4586.spq
    data: |
      SELECT 34 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN col2 * - + col1 - - 32 + 37 * + 90 AND - - CAST ( NULL AS INTEGER ) * - 11;
  - name: tab1

outputs:
  - name: q4586.out
    data: |
